import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

import { BrowserRouter } from 'react-router-dom'
import Shop from './Shop/Shop';


class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div className="App">
          <Shop />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
